import React, { Component } from 'react';

import blurOnIcon from '@material-ui/icons/adjust';

import './TopNav.scss';

class TopNav extends Component {
  render() {
    return(
      <nav>
        <ul>
          <li>Home</li>
          <li>Other</li>
          <li>Other2</li>
        </ul>
        <a href="http://abwtechnologies.com" target="_blank">
          <blurOnIcon />
        </a>
      </nav>
    );
  }
}

export default TopNav;
